import React from 'react';
import './App.css';
import data from './data/medicines.json';
function App() {
  const newdata = data.map(data => {
    return (
      <div className="medicine">
        {data.name}
      </div>
    );
  });
  return (<div className="medicines_wrapper">{newdata}</div>);
}

export default App;
